    class Program
    {
        static void Main(string[] args)
        {//ZadatakBA1C

            //string s = "";
            //string s = "";
            string s = "";

            string sk = "";
            for (int i = s.Length - 1; i >= 0; i--)
            {
                if (s.Substring(i, 1) == "A")
                {
                    sk += "T";
                }
                else if (s.Substring(i, 1) == "T")
                {
                    sk += "A";
                }
                else if (s.Substring(i, 1) == "G")
                {
                    sk += "C";
                }
                else
                {
                    sk += "G";
                }




            }
            
            Console.WriteLine(sk);
            Console.ReadLine();
        }
    }
